import { createBrowserRouter, Outlet } from "react-router-dom";
import Home from "./pages/home";
import Posts from "./pages/posts";

const AppLayout = () => (
  <>
    <Header />
    <Outlet />
  </>
);

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  },
  {
    path: "/posts",
    element: <Posts />,
  },
]);

export default router;
